(9, 'Prooviks', 'Kas pildid ikka töötavad?', 'Maiu', '2024-05-12 11:15:38', 'https://t4.ftcdn.net/jpg/04/42/21/53/360_F_442215355_AjiR6ogucq3vPzjFAAEfwbPXYGqYVAap.jpg'),
(10, 'Surviving Mars', 'Valasin üllatavalt palju pisaraid oma esimese punase planeedi koloonia asutamise ajal Surviving Marsil. Kiirustan lisama, et ühelgi neist pisaratest polnud pistmist torulekkega, mis tappis 58 inimest. Nende puhul ma lihtsalt vandusin oma remondidroone ja panin rohkem koloniste polümeeritehases kurnavaid öiseid vahetusi tegema, et saaksime õhutorusid lappida.  Ma kardan, et mu pisarad tulid hoopis minu enda suurejoonelisuse tunnistuseks: kui loid töörobotite ja automatiseeritud tehaste patrullitud tolmune liivalaik nägi oma esimest biokupli ehitamist, kui esimesed inimesed Maalt tulid mängu. välja uue elu selles kohas, mille olin neile ehitanud, kui sündis esimene mitte-Maa laps. Elage minu töö sees, marslased, ja püüdke mitte meteooritormi sattuda.', 'Maiu Ild', '2024-05-12 17:35:06', 'https://assets.rockpapershotgun.com/images//2018/03/surviving-mars-review-2-620x330.jpg'),
(11, 'Age of empires IV', 'Age of Empires 4 põhineb tugeval alusel, mis loodi eelmisel aastatuhandel, kuid sellel on palju tüütuid vigu ja puudusi. Mõned neist parandatakse plaastrite ja võib-olla tulevaste DLC-dega, kui meil veab, kuid isegi siis on see Age of Empires 2-st kaugel.', 'Maiu Ild', '2024-05-12 17:43:09', 'data:image/jpeg;base64,'),
(12, 'Killing floor II', 'See näitab Tripwire\'i uhkust ja pühendumust sellele mängule. Üldiselt on Killing Floor 2 tohutu, hõlpsasti õpitav mäng, millel on palju sisu, jõhker heliriba, rahuldav võitlus, ladusad juhtnupud ja hea mängijabaas. Kindlasti soovitan seda mängu!', 'Maiu Ild', '2024-05-12 17:44:30', 'data:image/jpeg;base64,'),
(13, 'Cities: Skyline II', 'Praeguses olekus Cities: Skylines 2-le on mõttetu aega kulutada. Arendajad peaksid otsustama, mis on tõesti oluline – mängu parandamine või DLC-de vabastamine.\r\n', 'Maiu Ild', '2024-05-12 17:46:17', 'data:image/jpeg;base64,');

